    umlCategory_7480.set_Documentation("The investigation of the structure of the neural circuitry running between different populations of " + 
    	"neurons was revolutionised thirty years ago with the advent of tract-tracing experiments. This permi" + 
    	"tted researchers to identify the regions of origin and termination of long axonal connections (Lasek" + 
    	" et al. 1968, Kristensson et al. 1971). These techniques have been significantly refined (see Kobber" + 
    	"t et al. 2000 for a recent review), so that neuroanatomists can now describe connections in terms of" + 
    	" the precisely-defined positions of the somata and terminal fields of labelled cells on templates ta" + 
    	"ken from a standard brain atlas (e.g. see Canteras et al. 1992, Risold et al. 1994 for two examples)" + 
    	". <BR><BR>The basic design of tract-tracing experiments is common across almost all methods. An ex" + 
    	"perimental animal is anaesthetised and small amounts of tracer chemicals are injected into the regio" + 
    	"n of the brain under investigation. The tracer is taken up by the parts of neurons which extend into" + 
    	" the injection site, typically at axonal terminals or dendritic arbours. Then the tracer is transpor" + 
    	"ted along the cell's axon by intracellular transport mechanisms, either anterogradely from the cell " + 
    	"body to the axonal terminals, or retrogradely, in the opposite direction, or both. Finally, the anim" + 
    	"al is killed, and its brain sectioned and stained to reveal a pattern that shows the distribution of" + 
    	" transported label (Blackstad et al. 1981). The end product is a three-dimensional map of tracer con" + 
    	"centration at the time of the animal's death. Since tracer is originally applied in a localised inje" + 
    	"ction to a small region of the brain, labelled regions of the brain must be connected to the injecti" + 
    	"on site. The data are usually presented as photographs or drawings of sections which show the distri" + 
    	"bution of label throughout the brain (Swanson 1998). <BR><BR>");
